import React from 'react';
import { Link } from 'react-router-dom';
import './Header.css'; // Certifique-se de que esse arquivo exista

function Header() {
  return (
    <header className="header">
      <div className="logo">
        <img src={require('../assets/logo.png')} alt="Aloha Turismo" className="logo-img" />
      </div>
      <nav className="nav-menu">
        <Link to="/" className="nav-link">Início</Link>
        <Link to="/alugueldeonibus" className="nav-link">Aluguel de Ônibus</Link>
        <Link to="/turismo" className="nav-link">Turismo</Link>
        <Link to="/nossafrota" className="nav-link">Nossa Frota</Link>
        <Link to="/contato" className="nav-link">Contato</Link>
      </nav>
    </header>
  );
}

export default Header;
